import React from 'react'
import Select from 'react-select'

function CustomSelect(props) {
  return (
    <Select
    options={props.options}
    noOptionsMessage={'Нет'}
    theme={(theme) => ({
      ...theme,
      borderRadius: 0,
      backgroundColor: 'transparent',
      color: 'white',
    })}
  />
  )
}

export default CustomSelect
